import React from 'react'
import "./share.css";

function Share() {
  return (
    <div className="share">
        <div className='sharedWrapper'>
            <div className="shareTop">
                <img className="shareProfileImg" src="/assets/profile.jfif" alt=""/>
                <input type="text" className='shareInput'/>
            </div>
            <div className="shareBottom"></div>
        </div>

    </div>
  )
}

export default Share
